import banner from "../../Assets/images/banner-4.jpeg";
import blog from "../../Assets/images/blog-img-1.jpeg";
import blog2 from "../../Assets/images/blog-img-2.jpeg";

export default function Home() {
  return (
    <>
      <div className="container bg-main">
        <img src={banner} alt="" />
      </div>
    </>
  );
}
